import React, { Component } from "react";

//SHOULD YOU ENUMERATE WHITE

const Title = styled.h1`
    font-weight: 800;
    font-size: 30px;
    font-family: Arial;
    margin: 0px 0px 20px;
    color: rgba(255, 255, 255, 1);
`;

const Content = styled.p`
    font-weight: normal;
    font-size: 15px;
    font-family: Arial;
    margin: 0px 0px 20px;
    color: rgba(255, 255, 255, 1);
`;

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    const styles = {
      white: (opacity = 1) => `rgba(255, 255, 255, ${opacity})`,
      black: (opacity = 1) => `rgba(0, 0, 0, ${opacity})`,
      topBarHeight: 40,
      footerMenuHeight: 50
    };

    // const menuItems = [
    //   { icon: `ðŸ˜€`, text: "Item 1" },
    //   { icon: `ðŸ˜‰`, text: "Item 2" },
    //   { icon: `ðŸ˜Ž`, text: "Item 3" },
    //   { icon: `ðŸ¤”`, text: "Item 4" },
    //   { icon: `ðŸ˜›`, text: "Item 5" }
    // ];  

    return (
      <div
        style={{
          backgroundColor: styles.black(0.05),
          minHeight: "100vh",
          position: "relative"
        }}
      >
        <Thumbnail styles={styles} background={styles.black()}>Hi HI</Thumbnail>
      </div>
    );
  }
}

export default App;
